module.exports = function (){
  return {
    add: function(num1, num2) {
         console.log(num1+num2);
         return num1+num2;
    },
    multiply: function(num1, num2) {
         console.log(num1*num2);
         return num1*num2;
    },
    square: function(num) {
         console.log(num*num);
         return num*num
    },
    random: function(num1, num2) {
      var rand = Math.ceil(Math.random());
      if(rand == 0){
        console.log(num1);
        return num1;
      }
      if(rand == 1){
        console.log(num2);
        return num2;
      }
    }
  }
}();
